import './App.css';

import Expenses from './Expense';

function App() {

  const expenses = [
    {
      id: 'e1',
      title: 'Alu Puri',
      amount: 30,
      date: new Date(2020, 7, 14),
    },
    { id: 'e2', title: 'Udemy Course', amount: 499, date: new Date(2021, 2, 12) },
    {
      id: 'e3',
      title: 'Fuel',
      amount: 310,
      date: new Date(2021, 2, 28),
    },
    {
      id: 'e4',
      title: 'Splendor',
      amount: 85000,
      date: new Date(2021, 5, 12),
    },
  ];


  return (
    <Expenses items = { expenses} />
  );
}

export default App;
